    <div className='w-full mx-auto relative'>
      <div
        style={{ top: 32 }}
        id='tableSmallScreen'
        className='w-48 absolute bg-white w-40 z-50'>
        <div className='py-5'>
          <h3
            style={{ fontFamily: 'airbnb-bold' }}
            className='text-gray-750 text-2xl'>
            {head.column1}
          </h3>
