                      </div>
                    </td>
                  </tr>
                </>
              );
            })}
          </tbody>
        </table>
      </div>

      <div className='mt-3 mb-32 lg:my-3'>
        <p
          style={{ fontFamily: 'airbnb-book' }}
          className='text-gray-650 text-sm'>
          Last updated June 2018
        </p>
      </div>
    </div>
  );
};
